                    "author_name" : "Nick Theodoropoulos",
                    "author_url" : "https://plus.google.com/112066951346465082568",
                    "language" : "en",
                    "rating" : 5,
                    "text" : "Before I start, I have to say I have a small business and I have been advertising through Google Products for the last 6 years. For the last 2 years my website has had a penalty from Google and my site is completely out from Google results. However, I have not forgotten the business I've received in the prior 4 years to the penalty, Google has helped my business grow from being self-employed to a business that now employees over 20 people. Before I started advertising on Google, I used the local paper and the yellow pages in doing this I lost a lot of money. I hope my website comes back one day to Google results, if not I would still like to say a BIG thank-you to Google for what you have made my business today. I highly recommend to any small business to advertise this way though Google as I have had nothing but great results.  ",
                    "time" : 1404189176
                 },
                 {
                    "aspects" : [
                       {
                          "rating" : 3,
