                    "author_name" : "Robert Limb",
                    "author_url" : "https://plus.google.com/100789161914871728582",
                    "language" : "en",
                    "rating" : 4,
                    "text" : "There is a new Railway Station located at Seaford Meadows in South Australia.  It is located on a triangular piece of landed bounded by Seaford Road and Dungey Road Seaford Meadows. \nThere are over 500 car parks. It was officially opened for business on 23 February 2014. It is not shown at all as  available on Google Maps under the heading \"Get Directions\"   I have tried in vain to have this situation rectified without any luck.   There is also a new Railway Station located at Seaford as an interchange, (On the same line) ..... that is shown ok on the maps.\n\nThanks ",
                    "time" : 1394693578
                 },
                 {
                    "aspects" : [
                       {
                          "rating" : 3,
                          "type" : "overall"
                       }
                    ],
                    "author_name" : "William Bond",
                    "author_url" : "https://plus.google.com/106542425349524667212",
                    "language" : "en",
                    "rating" : 5,
                    "text" : "A pretty darn awesome place! Google Sydney office are located opposite the Star, and are a pretty awesome place to visit if you get the chance. In the off chance that you get a job here - well done! From the wall of wildlife, to the scooters, to the monorail carriage, this place looks like it would be great to work at!",
                    "time" : 1398513642
                 },
                 {
                    "aspects" : [
                       {
                          "rating" : 3,
                          "type" : "overall"
                       }
                    ],
                    "author_name" : "Yongzhen Chen",
                    "author_url" : "https://plus.google.com/115506966242832684734",
                    "language" : "en",
                    "rating" : 5,
                    "text" : "This is my favorite place; I have visited the inside and it looks marvelous. It's colourful and bright as opposed to other corporations' offices. Everything is colour coded using their four main colours - red, yellow, green and blue. It's a lovely sight to see.",
